import { Button } from '@mui/material';
import React, { useState, useEffect  } from 'react';
import { useUser, UserContext } from "../contexts/user.context";
import '../static/Home.Page.css'; // Import CSS file

export default function Home() {
  // const { logOutUser } = useContext(UserContext);
  const { logOutUser } = useUser();

  const logOut = async () => {
    try {
      const loggedOut = await logOutUser();
      if (loggedOut) {
        window.location.reload(true);
      }
    } catch (error) {
      alert(error);
    }
  };



  const UserList = () => {
    const [users, setUsers] = useState([]);

    useEffect(() => {
      const fetchUsers = async () => {
        try {
          const response = await fetch('/api/users'); // Ensure this matches your server's route
          if (!response.ok) throw new Error('Failed to fetch');
          const data = await response.json();
          setUsers(data);
        } catch (error) {
          console.error("Error fetching users:", error);
        }
      };

      fetchUsers();
    }, []);

    return (
      <div>
        <h2>User Details</h2>
        <ul>
          {users.map(user => (
            <li key={user._id}>{user.username} - {user.email}</li>
          ))}
        </ul>
      </div>
    );
  };





  const Navbar = () => {
    return (
      <nav className="navbar">
        <div className="navbar-left">
          <a href="#">Main Project</a>
        </div>
        <div className="navbar-right">
          <a class="Signup" href="/Signup">Signup</a>
          <Button
        variant="text" // Makes the button look more like a link
        onClick={logOut}
        style={{textTransform: 'none', textDecoration: 'underline'}}
      >
        Logout
      </Button>
        </div>
      </nav>
    );
  };

  return (
    <>
      <div className="main-page">
      <Navbar />
      {/* <CenterLinks /> */}
      <UserList /> {/* Render the UserList component here */}
    </div>

    </>
  );
}
